import styled from "@emotion/styled";

export const Tittle = styled.h2`
  font-size: 24px;
  font-weight: bold;
  margin-bottom: 16px;
  text-align: center;
`;



export const Text = styled.p`
  color: red;
  font-size: 18px;
  text-align: center;
margin - top: 20px;
`;
